import React, { useEffect, useState } from "react";
import axios from "axios";

const Home = (props) => {
    const [data, setData] = useState([]);


    function getDummyData() {
        axios.get('https://jsonplaceholder.typicode.com/todos/1').then((res) => {
            if(!res.status == 200) return;

        })
    }

    useEffect(() => {
       getDummyData();
    }, [])

    return (
        <>
        <button>
         Click Me
        </button>
        </>
    )
}

export default Home;
